import styled from "styled-components";

export const Transaction = styled.div`
  .contain {
    width: 40%;
    height: 100%;
    background: #141414;
    box-shadow: 0 5px 16px rgba(0, 0, 0, 0.2);
    color: white;
    display: grid;
    grid-taplate-colums: 1fr 1fr;
    position: relative;
    border-radius: 1px;
    left: 15em;
    bottom: 6em;

    .contain .list {
      list-style: none;
      display: block;
    }
  }
`;
